    name: 'Внешний аккумулятор TFN PB-278-BK 10000mAh',
    color: 'black',
    type: 'Внешний аккумулятор',
    img: './images/всеТовары/access/TFN-pb249bk_20ah_black.png',
    price: 790,
},
{
    name: 'vipe USB lightning MFI',
    color: 'blue',
    type: 'USB кабель',
    img: './images/всеТовары/access/vipe-usb-lightning-MFI-blue.jpg',
    price: 249,
},
]
access.forEach(item=>item.category='access');
addKey(access);
